商品名：アテント　消臭効果付きテープ式　M　背モレ・横モレも防ぐお試しパック<br>内容量：9枚<br>ブランド：アテント<br>原産国：日本<br><br>まずは一週間お試しください！<br>「背モレ防止ポケット」「横モレ防止ギャザー」が背モレ・横モレをしっかり防止。吸収ポリマーが、尿と一緒にアンモニアなどのニオイをしっかり吸収。（洗いたての肌着の香り付き）おむつの中心と体の中心を合わせやすい、センターライン（中央線）採用。約１週間お試しパック。<br><br>JANコード:4902011771237<br><br><br>商品番号：101-30772<br><br><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
