リフレ 安心パッド スーパー 150cc 16枚入<br>ブランド：リフレ<br>販売・製造元：livedo(リブドゥ)<br><br>軽い失禁が気になる方のための尿とりパッドです。<br>なめらなデリケートタッチでやさしい肌ざわり。<br>うすくても頼れる高速パワフル吸収シートでサラサラな状態を保ちます。<br>天然フラボノイド配合の消臭＆除菌シートにより、快適でニオイも気になりません。<br>モレ止めギャザー付き。<br>長時間用スーパー：150cc吸収。<br> <br><br>日用品／生理用品／尿もれ用シート・パッド／尿もれ用シート・パッド 多量・長時間用<br>JANコード： 4904585026034<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
