商品名：リフレ　ズレなく快適紙パンツ用パッド夜用<br>内容量：18枚<br>ブランド：リフレ<br>原産国：日本<br><br>すっきり形状で動きやすくくっつきテープでズレにくい<br>前後のくっつきテープが、紙パンツにぴったりついてパッドのズレを防止します。股ぐりカットが紙パンツにぴったりおさまります。透湿性シートがおむつ内の湿気を逃し、ムレによる肌トラブルを防ぎます。二つ折り形状で紙パンツに着けやすい。高さのある立体ギャザーが身体にフィットして横モレを防ぎます。「まえ」マーク入りで、前後がわかりやすい。<br>成分：表面材：紙おむつの一番外側の部分。吸水材：紙おむつの内部で尿をしっかりキャッチする部分。防水材：吸収した尿を外にもらさないためのもの。止着材：おむつを止めるテープのこと。伸縮材：おむつに伸縮性をもたせるためのもの。結合材：おむつの各パーツをくっつけるためのもの。<br>使用方法：パンツをおろし、パッドを後ろ側からパンツの中に差し込む。パッドの端をパンツの吸収体の端（青矢印のあたり）に合わせるように押し付ける。パッドを前に向かって広げるようにして、パンツに押し付ける。<br>問合せ先：（株）リブドゥコーポレーションお客様相談室　〒５４１－００４８大阪市中央区瓦町１－６－１０　０１２０－２７１－３６１<br><br>JANコード:4904585017483<br><br><br>商品番号：101-41322<br><br><br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
